    isPlaying = false;

function init() {
    myAudioContext ? myAudioContext.close() : (()=>{})();
    myAudioContext = new (window.AudioContext || 
    window.webkitAudioContext || 
    window.mozAudioContext || 
    window.oAudioContext || 
    window.msAudioContext)();
    // an analyser is used for the spectrum
    myAudioAnalyser = myAudioContext.createAnalyser();
    myAudioAnalyser.smoothingTimeConstant = 0.0;
myAudioAnalyser.fftSize = window.fft_size
    myAudioAnalyser.connect(myAudioContext.destination);

    fetchSounds();
}

function fetchSounds() {
    var request = new XMLHttpRequest();
    for (var i = 0, len = SOUNDS.length; i < len; i++) {
        request = new XMLHttpRequest();
        // the underscore prefix is a common naming convention
        // to remind us that the variable is developer-supplied
        request._soundName = SOUNDS[i];
        request.open('GET', request._soundName, true);
        request.responseType = 'arraybuffer';
        request.addEventListener('load', bufferSound, false);
        request.send();
    }
}

function bufferSound(event) {
    var request = event.target;
    var source = myAudioContext.createBufferSource();

    myAudioContext.decodeAudioData(request.response, function(buffer) {
    source.buffer = buffer;

    source.connect(myAudioContext.destination);
    // source.loop = true
    myBuffers[request._soundName] = source;
},

function(e){ console.log("Error with decoding audio data" + e.err); });

}

function selectRandomBuffer() {
    var rand = Math.floor(Math.random() * SOUNDS.length);
    var soundName = SOUNDS[rand];
    return myBuffers[soundName];
}

function routeSound(source) {
    source.connect(myAudioAnalyser);
    return source;
}

function playSound() {
    // create a new AudioBufferSourceNode
    var source = myAudioContext.createBufferSource();
    source.buffer = selectRandomBuffer().buffer;
    source = routeSound(source);
    // play right now (0 seconds from now)
    // can also pass 

    source.start(0, window.currentTime ? window.currentTime: 0);
    mySpectrum = setInterval(drawSpectrum, 30);
    mySource = source;
}

function pauseSound() {
    var source = mySource;
    source.stop();
    clearInterval(mySpectrum);
}

